// @flow
import React, { Component } from 'react';
export default class Home extends Component {

    render() {
        
        return (
            <div class="page-content fade-in-up">
                
                <div class="page-heading">
                    <h3 class="page-title">Top Stories</h3>
                    
                </div>

                
                <div class="row">
                    <div class="col-md-12">
                        <div className="dadhboardscroller">
                            <div class="row">	
                                <div class="col-md-3">
                                
                                    <div class="card-deck">
                                        <div class="card">
                                            <div class="card-header">
                                                
                                                <span class="pull-left text-muted font-13">Instagram</span>
                                            </div>
                                            
                                            
                                            <img class="card-img-top" src="/img/image.png" />
                                            
                                            <div class="card-footer">
                                                <a class="text-info"><i class="fa fa-eye"></i> 2.5k</a> &nbsp; &nbsp;&nbsp;
                                                <a class="text-info"><i class="fa fa-eye"></i> 2.5s</a> &nbsp; &nbsp;&nbsp; 
                                                <a class="text-info"><i class="fa fa-share"></i> 755</a> &nbsp; &nbsp;&nbsp;
                                                
                                            </div>
                                        </div>
                                        
                                    </div>
                                
                                </div>
                            </div>
                        </div>
                    </div>
                </div>


            </div>

        );
    }
}
